import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import PropTypes from 'prop-types';
import { Container, Row, Table, Badge } from 'react-bootstrap';

class Order extends Component {

  render() {
    return (
      <div>
        <Container>
          <Row>
            <Table responsive>
              {/* <thead>
                <tr>
                  <th>Order Number</th>
                  <th>Status</th>
                  <th>Created Time</th>
                  <th>Total Price</th>
                </tr>
              </thead> */}
              <tbody>
                <tr>
                  <td>{this.props.order._id}</td>
                  <td>
                    {this.props.order.status === "open" ? (
                      <Badge variant="success">{this.props.order.status}</Badge>
                          ) : (
                            <Badge variant="danger">{this.props.order.status}</Badge>
                          )}
                  </td>
                  <td>{this.props.order.createdAt}</td>
                  <td>price here</td>
                </tr>
              </tbody>
            </Table>
          </Row>
        </Container>
      </div>
    );
  }
}

Order.propTypes = {
  order: PropTypes.object.isRequired
}

export default withRouter(Order);
